import React from 'react';
import styles from './styles.module.scss';
import tracks from '../../components/Track';

const Race = () => {
  return (
    <div>
      {tracks.map((track) => (
        <div key={track.name}>
          <h2>{track.title}</h2>
          <p>{track.description}</p>
          <div> Ranking prize:
            <span>Ranking prize:
            {
              track.ranking.map((rank) => (
                  <div>
                    <p>{rank.name}</p>
                    <span>{rank.win}</span>
                  </div>
              ))
            }
            </span>
          </div>
          <div>{track.button}</div>
        </div>
      ))}
    </div>
  );
};

export default Race;
